import { Link } from "react-router-dom";

const navItems = [
  "Home", "About", "Education", "Working Experience",
  "Licenses and Certifications", "Organization",
  "Skills", "Honorary Titles and Awards", "Technologies"
];

export default function Navbar() {
  return (
    <nav className="bg-gray-800 text-white p-4 shadow-md">
      <ul className="flex flex-wrap gap-4">
        {navItems.map(item => (
          <li key={item}>
            <Link to={`/${item.toLowerCase().replace(/ /g, "-")}`} className="hover:text-gray-300">
              {item}
            </Link>
          </li>
        ))}
      </ul>
    </nav>
  );
}
